import Document, { Head, Main, NextScript } from 'next/document';

class MyDocument extends Document {
  render() {
    return (
      <html lang='en'>
        <Head>
          <meta name='desctiption' content='Price Computer Education' />
          <meta charset='utf-8' />
          <meta name='robot' content='noindex, nofollow' />
          <meta name='viewport'></meta>
          <link rel='stylesheet' href='https://cdnjs.cloudflare.com/ajax/libs/nprogress/0.2.0/nprogress.min.css'></link>
          {/* <link href='https://fonts.googleapis.com/css?family=Roboto&display=swap' rel='stylesheet'></link> */}
          <link href='https://fonts.googleapis.com/css?family=Poppins&display=swap' rel='stylesheet'></link>
        </Head>
        <body>
          <Main></Main>
          <NextScript></NextScript>
        </body>
        <style global jsx>{`
          body {
            // font-family: 'Roboto', sans-serif;
            font-family: 'Poppins', sans-serif;
          }
        `}</style>
      </html>
    );
  }
}
export default MyDocument;
